webpackJsonp([0],{53:function(n,s){n.exports={date:"2017-04-14T09:33:26.000Z",content:'<p>FunBook is a framework helping you build websites really fast.</p>\n<p>Briefly speaking, it gives you the UI, you fill it with the contents.</p>\n<p>Letâ€™s learn by example:</p>\n<pre><code class="language-js"><span class="token comment" spellcheck="true">// In webpack you can </span>\n<span class="token comment" spellcheck="true">// import FunBook from \'funbook\'</span>\n<span class="token comment" spellcheck="true">// and `new FunBook()` directly</span>\n<span class="token keyword">const</span> book <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">FunBook<span class="token punctuation">.</span>default</span><span class="token punctuation">(</span><span class="token punctuation">{</span>\n  title<span class="token punctuation">:</span> <span class="token string">\'My Awesome Book\'</span><span class="token punctuation">,</span>\n  nav<span class="token punctuation">:</span> <span class="token punctuation">[</span><span class="token punctuation">{</span>\n    title<span class="token punctuation">:</span> <span class="token string">\'Home\'</span><span class="token punctuation">,</span>\n    path<span class="token punctuation">:</span> <span class="token string">\'/\'</span>\n  <span class="token punctuation">}</span><span class="token punctuation">]</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span>\n\n<span class="token comment" spellcheck="true">// Add homepage</span>\nbook<span class="token punctuation">.</span><span class="token function">page</span><span class="token punctuation">(</span><span class="token punctuation">{</span>\n  title<span class="token punctuation">:</span> <span class="token string">\'Home\'</span><span class="token punctuation">,</span>\n  path<span class="token punctuation">:</span> <span class="token string">\'/\'</span><span class="token punctuation">,</span>\n  content<span class="token punctuation">:</span> <span class="token string">\'Home Page\'</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span>\n\n<span class="token comment" spellcheck="true">// Add a chapter</span>\nbook<span class="token punctuation">.</span><span class="token function">chapter</span><span class="token punctuation">(</span><span class="token punctuation">{</span>\n  title<span class="token punctuation">:</span> <span class="token string">\'Intro\'</span><span class="token punctuation">,</span>\n  content<span class="token punctuation">:</span> <span class="token string">\'&lt;strong>My first chapter&lt;/strong>\'</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span>\n\n<span class="token comment" spellcheck="true">// Open book at `#root` element as a single page app (hash router)</span>\nbook<span class="token punctuation">.</span><span class="token function">open</span><span class="token punctuation">(</span><span class="token string">\'#root\'</span><span class="token punctuation">,</span> <span class="token punctuation">{</span>\n  routerMode<span class="token punctuation">:</span> <span class="token string">\'hash\'</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span>\n</code></pre>\n<p>Try it on <a href="http://jsfiddle.net/aprilorange/h6m5bxqv/10">JSFiddle</a>.</p>\n<p>Which is worth noting, the <code>content</code> property supports following types of values:</p>\n<ul>\n<li>string: Treated as HTML</li>\n<li>object\n<ul>\n<li>has <code>render</code> or <code>template</code> property: Vue component</li>\n<li>has <code>content</code> property: HTML string</li>\n</ul>\n</li>\n<li>Function: return a Promise which resolves an object</li>\n</ul>\n'}}});
